// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;
pragma experimental ABIEncoderV2;

import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "./Quote.sol";

contract QuoteFactory is Ownable {
    using SafeMath for uint256;

    event AddQuote(address indexed quoteAddr);
    event AddPrice(string indexed symbol, uint256 indexed newPrice);
    event DelPrice(string indexed symbol, uint256 indexed blockIndex);

    mapping (string => address) private allQuotePool;// <btc/usdt,quoteAddr>
    string[] private allSymbol;

    // 添加交易标的的行情
    function addQuote(string memory _symbol) public onlyOwner returns (address quoteAddr) {
        require(allQuotePool[_symbol] == address(0), 'addQuote: Quote_EXISTS');
        bytes memory bytecode = type(Quote).creationCode;
        bytes32 salt = keccak256(abi.encodePacked(_symbol));
        assembly {
            quoteAddr := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        Quote(quoteAddr).initialize(_symbol);
        Quote(quoteAddr).transferOwnership(msg.sender);
        allQuotePool[_symbol] = quoteAddr;        
        allSymbol.push(_symbol);
        emit AddQuote(quoteAddr);
    }

    // 添加报价
    function addPrice(string memory _symbol,uint256[] memory price) public onlyOwner {
        address quoteAddr = getAddr(_symbol);
        uint256 newprice = Quote(quoteAddr).addPrice(price);
        emit AddPrice(_symbol, newprice);
    } 

    // 删除指定报价
    function delPrice(string memory _symbol,uint256 blockIndex) public onlyOwner {
        address quoteAddr = getAddr(_symbol);
        Quote(quoteAddr).delPrice(blockIndex);
        emit DelPrice(_symbol, blockIndex);
    }

    // 查询最新报价
    function getNewPrice(string memory _symbol) public view returns (uint256 blockIndex,uint256 newPrice,uint256 priceTime) {
        address quoteAddr = getAddr(_symbol);
        (blockIndex, newPrice, priceTime) = Quote(quoteAddr).getNewPrice();
    }

    // 查询未处理的报价
    function getLastPrice(string memory _symbol,uint256 _blockIndex) public view returns (uint256 blockIndex,uint256 newPrice,uint256 priceTime) {
        address quoteAddr = getAddr(_symbol);
        (blockIndex, newPrice, priceTime) = Quote(quoteAddr).getLastPrice(_blockIndex);
    }

    // 查询行情标的合约地址
    function getAddr(string memory _symbol) public view returns (address quoteAddr) {
        quoteAddr = allQuotePool[_symbol];
        require(quoteAddr != address(0), 'getAddr: Quote_NOT_EXISTS');
    }    

    function symbolLength() public view returns(uint256) {
        return allSymbol.length;
    }

    function getSymbol(uint256 _index) public view returns(string memory) {
        return allSymbol[_index];
    }

    function symbols() public view returns(string[] memory) {
        return allSymbol;
    }
}
